import React from "react";
import {NavLink} from "react-router-dom";

const Navbar = () =>{
    return(
        <>
        <nav className="justify-center flex text-slate-200 text-xl space-x-4 uppercase cursor-pointer bg-zinc-500">
           <NavLink  to="/" className="hover:bg-orange-400"> About Us </NavLink>
           <NavLink  to="contact" className="hover:bg-orange-400"> Contact Us </NavLink>
           <NavLink  to="pokeApi" className="hover:bg-orange-400"> PokeApi </NavLink>
           <NavLink  to="covid19" className="ani animate-pulse hover:bg-orange-400"> Covid Tracker </NavLink>
        </nav>
           
        </>
    )
}

export default Navbar;
